export default class LavaRapido {
  constructor(nome, rua, numero, bairro, complemento, cidade, uf, cep) {
    this.ds_nome = nome;
    this.ds_rua = rua;
    this.ds_numero = numero;
    this.ds_bairro = bairro;
    this.ds_complemento = complemento;
    this.ds_cidade = cidade;
    this.ds_uf = uf;
    this.ds_cep = cep;
  }
}
